import React from 'react';
import { useCart } from '../CartContext';

const CartPage = () => {
  const { cart } = useCart();

  return (
    <div>
      <h2>עגלה</h2>
      {cart.length === 0 ? (
        <p>העגלה ריקה</p>
      ) : (
        <ul>
          {cart.map((item, index) => (
            <li key={index}>{item.name} - {item.price}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default CartPage;
